import ExpenseItem from "./ExpenseItem";


function Expenses({expenses}){
    return (
        <div>{
            expenses.map((item, index) => 
            <ExpenseItem
                key={index}
                title={item.title} 
                amount={item.amount}
                date={item.date}>
            </ExpenseItem>)
            }
       
        </div>

    );
}

export default Expenses;
